import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import {Button, Card, Container, Col, Row, CardColumns, } from 'react-bootstrap'


function App() {
  return (
    <div className="App">
    <header className='App-header'>

    <Row>

      <Button1 />
      <Cards />
    </Row>      

    </header>



    </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

function Cards() {
  return (
  <div>
  <CardColumns>
   <Card className='mb-3' style={{ color: "#000" }}>

      <Card.Body>
        hi
      <Card.Title>About</Card.Title>          
       </Card.Body>
   </Card>

   <Card className='mb-3' style={{ color: "#000" }}>

   <Card.Body>
     hi
      <Card.Title>
            About
      </Card.Title>          
      </Card.Body>
    </Card>

  </CardColumns>
  </div>
  );
}
export default App;
